"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[4449],{4449:e=>{e.exports=JSON.parse('{"ai21":{"description":"AI21 Labs construit des mod\xe8les de base et des syst\xe8mes d\'intelligence artificielle pour les entreprises, acc\xe9l\xe9rant l\'application de l\'intelligence artificielle g\xe9n\xe9rative en production."},"ai302":{"description":"302.AI est une plateforme d\'applications d\'IA \xe0 la demande, offrant l\'API d\'IA la plus compl\xe8te du march\xe9 ainsi que des applications d\'IA en ligne."},"ai360":{"description":"360 AI est une plateforme de mod\xe8les et de services IA lanc\xe9e par la soci\xe9t\xe9 360, offrant divers mod\xe8les avanc\xe9s de traitement du langage naturel, y compris 360GPT2 Pro, 360GPT Pro, 360GPT Turbo et 360GPT Turbo Responsibility 8K. Ces mod\xe8les combinent de grands param\xe8tres et des capacit\xe9s multimodales, largement utilis\xe9s dans la g\xe9n\xe9ration de texte, la compr\xe9hension s\xe9mantique, les syst\xe8mes de dialogue et la g\xe9n\xe9ration de code. Gr\xe2ce \xe0 une strat\xe9gie de tarification flexible, 360 AI r\xe9pond \xe0 des besoins vari\xe9s des utilisateurs, soutenant l\'int\xe9gration des d\xe9veloppeurs et favorisant l\'innovation et le d\xe9veloppement des applications intelligentes."},"aihubmix":{"description":"AiHubMix offre un acc\xe8s \xe0 divers mod\xe8les d\'IA via une interface API unifi\xe9e."},"akashchat":{"description":"Akash est un march\xe9 de ressources cloud sans autorisation, offrant des tarifs comp\xe9titifs par rapport aux fournisseurs cloud traditionnels."},"anthropic":{"description":"Anthropic est une entreprise ax\xe9e sur la recherche et le d\xe9veloppement en intelligence artificielle, offrant une gamme de mod\xe8les linguistiques avanc\xe9s, tels que Claude 3.5 Sonnet, Claude 3 Sonnet, Claude 3 Opus et Claude 3 Haiku. Ces mod\xe8les atteignent un \xe9quilibre id\xe9al entre intelligence, rapidit\xe9 et co\xfbt, adapt\xe9s \xe0 divers sc\xe9narios d\'application, allant des charges de travail d\'entreprise aux r\xe9ponses rapides. Claude 3.5 Sonnet, en tant que dernier mod\xe8le, a excell\xe9 dans plusieurs \xe9valuations tout en maintenant un bon rapport qualit\xe9-prix."},"azure":{"description":"Azure propose une vari\xe9t\xe9 de mod\xe8les IA avanc\xe9s, y compris GPT-3.5 et la derni\xe8re s\xe9rie GPT-4, prenant en charge divers types de donn\xe9es et t\xe2ches complexes, tout en s\'engageant \xe0 fournir des solutions IA s\xe9curis\xe9es, fiables et durables."},"azureai":{"description":"Azure propose une vari\xe9t\xe9 de mod\xe8les d\'IA avanc\xe9s, y compris GPT-3.5 et la derni\xe8re s\xe9rie GPT-4, prenant en charge divers types de donn\xe9es et des t\xe2ches complexes, s\'engageant \xe0 fournir des solutions d\'IA s\xe9curis\xe9es, fiables et durables."},"baichuan":{"description":"Baichuan Intelligent est une entreprise sp\xe9cialis\xe9e dans le d\xe9veloppement de grands mod\xe8les d\'intelligence artificielle, dont les mod\xe8les excellent dans les t\xe2ches en chinois telles que l\'encyclop\xe9die de connaissances, le traitement de longs textes et la cr\xe9ation, surpassant les mod\xe8les dominants \xe9trangers. Baichuan Intelligent poss\xe8de \xe9galement des capacit\xe9s multimodales de premier plan, se distinguant dans plusieurs \xe9valuations autoris\xe9es. Ses mod\xe8les incluent Baichuan 4, Baichuan 3 Turbo et Baichuan 3 Turbo 128k, chacun optimis\xe9 pour diff\xe9rents sc\xe9narios d\'application, offrant des solutions \xe0 bon rapport qualit\xe9-prix."},"bedrock":{"description":"Bedrock est un service propos\xe9 par Amazon AWS, ax\xe9 sur la fourniture de mod\xe8les linguistiques et visuels avanc\xe9s pour les entreprises. Sa famille de mod\xe8les comprend la s\xe9rie Claude d\'Anthropic, la s\xe9rie Llama 3.1 de Meta, etc., offrant une vari\xe9t\xe9 d\'options allant des mod\xe8les l\xe9gers aux mod\xe8les haute performance, prenant en charge des t\xe2ches telles que la g\xe9n\xe9ration de texte, les dialogues et le traitement d\'images, adapt\xe9es aux applications d\'entreprise de diff\xe9rentes tailles et besoins."},"bfl":{"description":"Un laboratoire de recherche en intelligence artificielle de pointe, b\xe2tissant l\'infrastructure visuelle de demain."},"cerebras":{"description":"Cerebras est une plateforme d\'inf\xe9rence IA bas\xe9e sur son syst\xe8me d\xe9di\xe9 CS-3, con\xe7ue pour offrir les services de LLM les plus rapides au monde, avec une r\xe9ponse en temps r\xe9el et un d\xe9bit \xe9lev\xe9. Elle est sp\xe9cialement con\xe7ue pour \xe9liminer la latence et acc\xe9l\xe9rer les flux de travail IA complexes, tels que la g\xe9n\xe9ration de code en temps r\xe9el et les t\xe2ches d\'agents."},"cloudflare":{"description":"Ex\xe9cutez des mod\xe8les d\'apprentissage automatique aliment\xe9s par GPU sans serveur sur le r\xe9seau mondial de Cloudflare."},"cohere":{"description":"Cohere vous apporte les mod\xe8les multilingues les plus avanc\xe9s, des fonctionnalit\xe9s de recherche sophistiqu\xe9es et un espace de travail AI sur mesure pour les entreprises modernes - le tout int\xe9gr\xe9 dans une plateforme s\xe9curis\xe9e."},"cometapi":{"description":"CometAPI est une plateforme de services offrant diverses interfaces de mod\xe8les avanc\xe9s, prenant en charge OpenAI, Anthropic, Google et bien d\'autres, adapt\xe9e \xe0 des besoins de d\xe9veloppement et d\'application vari\xe9s. Les utilisateurs peuvent choisir librement le mod\xe8le et le tarif optimaux selon leurs besoins, favorisant ainsi une meilleure exp\xe9rience en IA."},"comfyui":{"description":"Un puissant moteur open source de g\xe9n\xe9ration d’images, de vid\xe9os et d’audio, prenant en charge des mod\xe8les avanc\xe9s tels que SD, FLUX, Qwen, Hunyuan et WAN, avec des fonctionnalit\xe9s d’\xe9dition de flux de travail par nœuds et de d\xe9ploiement priv\xe9."},"deepseek":{"description":"DeepSeek est une entreprise sp\xe9cialis\xe9e dans la recherche et l\'application des technologies d\'intelligence artificielle, dont le dernier mod\xe8le, DeepSeek-V2.5, combine des capacit\xe9s de dialogue g\xe9n\xe9ral et de traitement de code, r\xe9alisant des am\xe9liorations significatives dans l\'alignement des pr\xe9f\xe9rences humaines, les t\xe2ches d\'\xe9criture et le suivi des instructions."},"fal":{"description":"Plateforme m\xe9dia g\xe9n\xe9rative destin\xe9e aux d\xe9veloppeurs"},"fireworksai":{"description":"Fireworks AI est un fournisseur de services de mod\xe8les linguistiques avanc\xe9s, ax\xe9 sur les appels de fonction et le traitement multimodal. Son dernier mod\xe8le, Firefunction V2, bas\xe9 sur Llama-3, est optimis\xe9 pour les appels de fonction, les dialogues et le suivi des instructions. Le mod\xe8le de langage visuel FireLLaVA-13B prend en charge les entr\xe9es mixtes d\'images et de texte. D\'autres mod\xe8les notables incluent la s\xe9rie Llama et la s\xe9rie Mixtral, offrant un support efficace pour le suivi et la g\xe9n\xe9ration d\'instructions multilingues."},"giteeai":{"description":"L\'API serverless de gitee ai fournit aux d\xe9veloppeurs d\'IA un service d\'api d\'inf\xe9rence grand mod\xe8le pr\xeat \xe0 l\'emploi."},"github":{"description":"Avec les mod\xe8les GitHub, les d\xe9veloppeurs peuvent devenir des ing\xe9nieurs en IA et cr\xe9er avec les mod\xe8les d\'IA les plus avanc\xe9s de l\'industrie."},"google":{"description":"La s\xe9rie Gemini de Google est son mod\xe8le IA le plus avanc\xe9 et polyvalent, d\xe9velopp\xe9 par Google DeepMind, con\xe7u pour le multim\xe9dia, prenant en charge la compr\xe9hension et le traitement sans couture de texte, code, images, audio et vid\xe9o. Adapt\xe9 \xe0 divers environnements, des centres de donn\xe9es aux appareils mobiles, il am\xe9liore consid\xe9rablement l\'efficacit\xe9 et l\'applicabilit\xe9 des mod\xe8les IA."},"groq":{"description":"Le moteur d\'inf\xe9rence LPU de Groq a excell\xe9 dans les derniers tests de r\xe9f\xe9rence des grands mod\xe8les de langage (LLM), red\xe9finissant les normes des solutions IA gr\xe2ce \xe0 sa vitesse et son efficacit\xe9 impressionnantes. Groq repr\xe9sente une vitesse d\'inf\xe9rence instantan\xe9e, montrant de bonnes performances dans les d\xe9ploiements bas\xe9s sur le cloud."},"higress":{"description":"Higress est une passerelle API cloud-native, n\xe9e au sein d\'Alibaba pour r\xe9soudre les probl\xe8mes de rechargement de Tengine affectant les connexions persistantes, ainsi que le manque de capacit\xe9s d\'\xe9quilibrage de charge pour gRPC/Dubbo."},"huggingface":{"description":"L\'API d\'inf\xe9rence HuggingFace offre un moyen rapide et gratuit d\'explorer des milliers de mod\xe8les adapt\xe9s \xe0 diverses t\xe2ches. Que vous soyez en train de prototyper une nouvelle application ou d\'exp\xe9rimenter les capacit\xe9s de l\'apprentissage automatique, cette API vous permet d\'acc\xe9der instantan\xe9ment \xe0 des mod\xe8les performants dans de nombreux domaines."},"hunyuan":{"description":"Un mod\xe8le de langage d\xe9velopp\xe9 par Tencent, dot\xe9 d\'une puissante capacit\xe9 de cr\xe9ation en chinois, d\'une capacit\xe9 de raisonnement logique dans des contextes complexes, ainsi que d\'une capacit\xe9 fiable d\'ex\xe9cution des t\xe2ches."},"infiniai":{"description":"Fournit aux d\xe9veloppeurs d\'applications des services de grands mod\xe8les performants, faciles \xe0 utiliser et s\xe9curis\xe9s, couvrant l\'ensemble du processus, de la conception des grands mod\xe8les \xe0 leur d\xe9ploiement en tant que service."},"internlm":{"description":"Organisation open source d\xe9di\xe9e \xe0 la recherche et au d\xe9veloppement d\'outils pour les grands mod\xe8les. Fournit \xe0 tous les d\xe9veloppeurs d\'IA une plateforme open source efficace et facile \xe0 utiliser, rendant les technologies de pointe en mati\xe8re de grands mod\xe8les et d\'algorithmes accessibles."},"jina":{"description":"Jina AI, fond\xe9e en 2020, est une entreprise leader dans le domaine de l\'IA de recherche. Notre plateforme de recherche de base comprend des mod\xe8les vectoriels, des r\xe9arrangeurs et de petits mod\xe8les de langage, aidant les entreprises \xe0 construire des applications de recherche g\xe9n\xe9ratives et multimodales fiables et de haute qualit\xe9."},"lmstudio":{"description":"LM Studio est une application de bureau pour d\xe9velopper et exp\xe9rimenter des LLM sur votre ordinateur."},"minimax":{"description":"MiniMax est une entreprise de technologie d\'intelligence artificielle g\xe9n\xe9rale fond\xe9e en 2021, d\xe9di\xe9e \xe0 la co-cr\xe9ation d\'intelligence avec les utilisateurs. MiniMax a d\xe9velopp\xe9 de mani\xe8re autonome diff\xe9rents mod\xe8les de grande taille, y compris un mod\xe8le de texte MoE \xe0 un trillion de param\xe8tres, un mod\xe8le vocal et un mod\xe8le d\'image. Elle a \xe9galement lanc\xe9 des applications telles que Conch AI."},"mistral":{"description":"Mistral propose des mod\xe8les avanc\xe9s g\xe9n\xe9raux, professionnels et de recherche, largement utilis\xe9s dans des domaines tels que le raisonnement complexe, les t\xe2ches multilingues et la g\xe9n\xe9ration de code. Gr\xe2ce \xe0 une interface d\'appel de fonction, les utilisateurs peuvent int\xe9grer des fonctionnalit\xe9s personnalis\xe9es pour des applications sp\xe9cifiques."},"modelscope":{"description":"ModelScope est une plateforme de mod\xe8les en tant que service lanc\xe9e par Alibaba Cloud, offrant une riche gamme de mod\xe8les d\'IA et de services d\'inf\xe9rence."},"moonshot":{"description":"Moonshot est une plateforme open source lanc\xe9e par Beijing Dark Side Technology Co., Ltd., offrant divers mod\xe8les de traitement du langage naturel, avec des applications dans des domaines vari\xe9s, y compris mais sans s\'y limiter, la cr\xe9ation de contenu, la recherche acad\xe9mique, les recommandations intelligentes, le diagnostic m\xe9dical, etc., prenant en charge le traitement de longs textes et des t\xe2ches de g\xe9n\xe9ration complexes."},"nebius":{"description":"Nebius fournit une infrastructure haute performance aux innovateurs en IA du monde entier en construisant de vastes clusters GPU et une plateforme cloud int\xe9gr\xe9e verticalement."},"newapi":{"description":"Plateforme open source d\'agr\xe9gation et de redirection unifi\xe9e de plusieurs services d\'IA"},"novita":{"description":"Novita AI est une plateforme offrant des services API pour divers grands mod\xe8les de langage et la g\xe9n\xe9ration d\'images IA, flexible, fiable et rentable. Elle prend en charge les derniers mod\xe8les open source tels que Llama3, Mistral, et fournit des solutions API compl\xe8tes, conviviales et \xe9volutives pour le d\xe9veloppement d\'applications IA, adapt\xe9es \xe0 la croissance rapide des startups IA."},"nvidia":{"description":"NVIDIA NIM™ fournit des conteneurs pour l\'inf\xe9rence de microservices acc\xe9l\xe9r\xe9s par GPU auto-h\xe9berg\xe9s, prenant en charge le d\xe9ploiement de mod\xe8les d\'IA pr\xe9-entra\xeen\xe9s et personnalis\xe9s dans le cloud, les centres de donn\xe9es, les PC personnels RTX™ AI et les stations de travail."},"ollama":{"description":"Les mod\xe8les propos\xe9s par Ollama couvrent largement des domaines tels que la g\xe9n\xe9ration de code, les calculs math\xe9matiques, le traitement multilingue et les interactions conversationnelles, r\xe9pondant \xe0 des besoins diversifi\xe9s pour le d\xe9ploiement en entreprise et la localisation."},"ollamacloud":{"description":"Ollama Cloud offre un service d\'inf\xe9rence h\xe9berg\xe9 officiellement, permettant un acc\xe8s pr\xeat \xe0 l\'emploi \xe0 la biblioth\xe8que de mod\xe8les Ollama, avec prise en charge d\'une interface compatible OpenAI."},"openai":{"description":"OpenAI est un institut de recherche en intelligence artificielle de premier plan au monde, dont les mod\xe8les, tels que la s\xe9rie GPT, font progresser les fronti\xe8res du traitement du langage naturel. OpenAI s\'engage \xe0 transformer plusieurs secteurs gr\xe2ce \xe0 des solutions IA innovantes et efficaces. Leurs produits offrent des performances et une rentabilit\xe9 remarquables, largement utilis\xe9s dans la recherche, le commerce et les applications innovantes."},"openrouter":{"description":"OpenRouter est une plateforme de service fournissant des interfaces pour divers mod\xe8les de pointe, prenant en charge OpenAI, Anthropic, LLaMA et plus encore, adapt\xe9e \xe0 des besoins de d\xe9veloppement et d\'application diversifi\xe9s. Les utilisateurs peuvent choisir de mani\xe8re flexible le mod\xe8le et le prix optimaux en fonction de leurs besoins, am\xe9liorant ainsi l\'exp\xe9rience IA."},"perplexity":{"description":"Perplexity est un fournisseur de mod\xe8les de g\xe9n\xe9ration de dialogue de premier plan, offrant divers mod\xe8les avanc\xe9s Llama 3.1, prenant en charge les applications en ligne et hors ligne, particuli\xe8rement adapt\xe9s aux t\xe2ches complexes de traitement du langage naturel."},"ppio":{"description":"PPIO Paiouyun offre des services API de mod\xe8les open source stables et rentables, prenant en charge toute la gamme DeepSeek, Llama, Qwen et d\'autres grands mod\xe8les de pointe dans l\'industrie."},"qiniu":{"description":"Qiniu est un fournisseur de services de cloud, offrant des API de IA de haute vitesse et d\'efficacit\xe9, incluant des mod\xe8les Alibaba, avec des options flexibles pour la construction et l\'application d\'applications IA."},"qwen":{"description":"Tongyi Qianwen est un mod\xe8le de langage \xe0 grande \xe9chelle d\xe9velopp\xe9 de mani\xe8re autonome par Alibaba Cloud, dot\xe9 de puissantes capacit\xe9s de compr\xe9hension et de g\xe9n\xe9ration du langage naturel. Il peut r\xe9pondre \xe0 diverses questions, cr\xe9er du contenu \xe9crit, exprimer des opinions, r\xe9diger du code, etc., jouant un r\xf4le dans plusieurs domaines."},"sambanova":{"description":"SambaNova Cloud permet aux d\xe9veloppeurs d\'utiliser facilement les meilleurs mod\xe8les open source et de b\xe9n\xe9ficier de la vitesse d\'inf\xe9rence la plus rapide."},"search1api":{"description":"Search1API offre un acc\xe8s \xe0 la s\xe9rie de mod\xe8les DeepSeek pouvant se connecter \xe0 Internet selon les besoins, y compris les versions standard et rapide, avec un choix de mod\xe8les de diff\xe9rentes tailles de param\xe8tres."},"sensenova":{"description":"SenseNova, soutenue par la puissante infrastructure de SenseTime, offre des services de mod\xe8les de grande taille complets, efficaces et faciles \xe0 utiliser."},"siliconcloud":{"description":"SiliconFlow s\'engage \xe0 acc\xe9l\xe9rer l\'AGI pour le b\xe9n\xe9fice de l\'humanit\xe9, en am\xe9liorant l\'efficacit\xe9 de l\'IA \xe0 grande \xe9chelle gr\xe2ce \xe0 une pile GenAI facile \xe0 utiliser et \xe0 faible co\xfbt."},"spark":{"description":"Le mod\xe8le Spark de iFlytek offre de puissantes capacit\xe9s IA dans plusieurs domaines et langues, utilisant des technologies avanc\xe9es de traitement du langage naturel pour construire des applications innovantes adapt\xe9es \xe0 divers sc\xe9narios verticaux tels que le mat\xe9riel intelligent, la sant\xe9 intelligente et la finance intelligente."},"stepfun":{"description":"Le mod\xe8le StepFun est dot\xe9 de capacit\xe9s multimodales et de raisonnement complexe de premier plan dans l\'industrie, prenant en charge la compr\xe9hension de textes tr\xe8s longs et des fonctionnalit\xe9s puissantes de moteur de recherche autonome."},"taichu":{"description":"L\'Institut d\'automatisation de l\'Acad\xe9mie chinoise des sciences et l\'Institut de recherche en intelligence artificielle de Wuhan ont lanc\xe9 une nouvelle g\xe9n\xe9ration de grands mod\xe8les multimodaux, prenant en charge des t\xe2ches de questions-r\xe9ponses compl\xe8tes, de cr\xe9ation de texte, de g\xe9n\xe9ration d\'images, de compr\xe9hension 3D, d\'analyse de signaux, avec des capacit\xe9s cognitives, de compr\xe9hension et de cr\xe9ation renforc\xe9es, offrant une toute nouvelle exp\xe9rience interactive."},"tencentcloud":{"description":"La capacit\xe9 atomique du moteur de connaissance (LLM Knowledge Engine Atomic Power) est une capacit\xe9 de question-r\xe9ponse compl\xe8te d\xe9velopp\xe9e sur la base du moteur de connaissance, destin\xe9e aux entreprises et aux d\xe9veloppeurs. Elle offre la possibilit\xe9 de cr\xe9er et de d\xe9velopper des applications de mod\xe8les de mani\xe8re flexible. Vous pouvez assembler votre service de mod\xe8le exclusif en utilisant plusieurs capacit\xe9s atomiques, en appelant des services tels que l\'analyse de documents, la s\xe9paration, l\'embedding, la r\xe9\xe9criture multi-tours, etc., pour personnaliser les affaires AI sp\xe9cifiques \xe0 votre entreprise."},"togetherai":{"description":"Together AI s\'engage \xe0 r\xe9aliser des performances de pointe gr\xe2ce \xe0 des mod\xe8les IA innovants, offrant une large capacit\xe9 de personnalisation, y compris un support d\'\xe9volutivit\xe9 rapide et un processus de d\xe9ploiement intuitif, r\xe9pondant \xe0 divers besoins d\'entreprise."},"upstage":{"description":"Upstage se concentre sur le d\xe9veloppement de mod\xe8les IA pour divers besoins commerciaux, y compris Solar LLM et Document AI, visant \xe0 r\xe9aliser une intelligence g\xe9n\xe9rale artificielle (AGI) pour le travail. Cr\xe9ez des agents de dialogue simples via l\'API Chat, et prenez en charge les appels de fonction, la traduction, l\'int\xe9gration et les applications sp\xe9cifiques \xe0 un domaine."},"v0":{"description":"v0 est un assistant de programmation en bin\xf4me. Il vous suffit de d\xe9crire vos id\xe9es en langage naturel, et il g\xe9n\xe8re le code et l\'interface utilisateur (UI) pour votre projet."},"vercelaigateway":{"description":"Vercel AI Gateway offre une API unifi\xe9e pour acc\xe9der \xe0 plus de 100 mod\xe8les, permettant d\'utiliser les mod\xe8les de plusieurs fournisseurs tels qu\'OpenAI, Anthropic, Google, via un point de terminaison unique. Il prend en charge la gestion du budget, la surveillance de l\'utilisation, l\'\xe9quilibrage de charge des requ\xeates et la tol\xe9rance aux pannes."},"vertexai":{"description":"La s\xe9rie Gemini de Google est son mod\xe8le d\'IA le plus avanc\xe9 et polyvalent, d\xe9velopp\xe9 par Google DeepMind, con\xe7u pour \xeatre multimodal, prenant en charge la compr\xe9hension et le traitement sans couture de texte, de code, d\'images, d\'audio et de vid\xe9o. Adapt\xe9 \xe0 divers environnements, des centres de donn\xe9es aux appareils mobiles, il am\xe9liore consid\xe9rablement l\'efficacit\xe9 et l\'applicabilit\xe9 des mod\xe8les d\'IA."},"vllm":{"description":"vLLM est une biblioth\xe8que rapide et facile \xe0 utiliser pour l\'inf\xe9rence et les services LLM."},"volcengine":{"description":"La plateforme de d\xe9veloppement des services de grands mod\xe8les lanc\xe9e par ByteDance, offrant des services d\'appel de mod\xe8les riches en fonctionnalit\xe9s, s\xe9curis\xe9s et comp\xe9titifs en termes de prix. Elle propose \xe9galement des fonctionnalit\xe9s de bout en bout telles que les donn\xe9es de mod\xe8le, le r\xe9glage fin, l\'inf\xe9rence et l\'\xe9valuation, garantissant ainsi le succ\xe8s de votre d\xe9veloppement d\'applications AI."},"wenxin":{"description":"Plateforme de d\xe9veloppement et de services d\'applications AI natives et de mod\xe8les de grande envergure, tout-en-un pour les entreprises, offrant la cha\xeene d\'outils la plus compl\xe8te et facile \xe0 utiliser pour le d\xe9veloppement de mod\xe8les d\'intelligence artificielle g\xe9n\xe9rative et le d\xe9veloppement d\'applications."},"xai":{"description":"xAI est une entreprise d\xe9di\xe9e \xe0 la construction d\'intelligences artificielles pour acc\xe9l\xe9rer les d\xe9couvertes scientifiques humaines. Notre mission est de promouvoir notre compr\xe9hension commune de l\'univers."},"xinference":{"description":"Xorbits Inference (Xinference) est une plateforme open source con\xe7ue pour simplifier l\'ex\xe9cution et l\'int\xe9gration de divers mod\xe8les d\'IA. Gr\xe2ce \xe0 Xinference, vous pouvez utiliser n\'importe quel LLM open source, mod\xe8le d\'embedding ou mod\xe8le multimodal pour effectuer des inf\xe9rences dans le cloud ou en local, et cr\xe9er des applications IA puissantes."},"zeroone":{"description":"01.AI se concentre sur les technologies d\'intelligence artificielle de l\'\xe8re IA 2.0, promouvant activement l\'innovation et l\'application de \\"l\'homme + l\'intelligence artificielle\\", utilisant des mod\xe8les puissants et des technologies IA avanc\xe9es pour am\xe9liorer la productivit\xe9 humaine et r\xe9aliser l\'autonomisation technologique."},"zhipu":{"description":"Zhipu AI propose une plateforme ouverte de mod\xe8les multimodaux et linguistiques, prenant en charge une large gamme de sc\xe9narios d\'application IA, y compris le traitement de texte, la compr\xe9hension d\'images et l\'assistance \xe0 la programmation."}}')}}]);